import React from 'react';
import {Link} from 'react-router-dom'
import CardComponentImg from '../../assets/example-card-img.png'
import './CardComponent.scss'
import CardsContent from '../../context/CardsContent';

const CardComponent = (props)=>{
    return(
            <div className="card-component"> 
                <img src={CardComponentImg}/>    
                <p className="card-component__title">Przepiękna sala weselna na 250 osób</p>
                <Link className="btn btn__card" to="/">Zobacz zdjęcia sali</Link>
            </div>
    );
}
export default CardComponent
